  "introduction.paragraph.why-use-it-3": "ICU \u30E1\u30C3\u30BB\u30FC\u30B8\u69CB\u6587\u3067\u30B5\u30DD\u30FC\u30C8\u3055\u308C\u3066\u3044\u308B\u5168\u3066\u306E\u6A5F\u80FD\u3092\u4F7F\u7528\u3057\u305F\u5834\u5408\u3001minify \u3068 \u5727\u7E2E\u3092\u884C\u3063\u305F\u3042\u3068\u3067\u7D042kb\u3068\u306A\u308A\u307E\u3059\u3002\u3082\u3057\u3044\u304F\u3064\u304B\u306E\u6A5F\u80FD\u3057\u304B\u4F7F\u308F\u306A\u3044\u306E\u3067\u3042\u308C\u3070\u30011kb\u7A0B\u5EA6\u307E\u3067\u5C0F\u3055\u304F\u3059\u308B\u3053\u3068\u304C\u3067\u304D\u307E\u3059\u3002",
