  "introduction.paragraph.features-1": "ICU \u30E1\u30C3\u30BB\u30FC\u30B8\u69CB\u6587\u3067\u30B5\u30DD\u30FC\u30C8\u3055\u308C\u3066\u3044\u308B\u3059\u3079\u3066\u306E\u6A5F\u80FD\u3092\u30B5\u30DD\u30FC\u30C8\u3057\u3066\u3044\u307E\u3059\u3002<br>Svelte.js \u5411\u3051\u306E\u56FD\u969B\u5316\u30E9\u30A4\u30D6\u30E9\u30EA\u3067\u3001\u975E\u5E38\u306B\u30DD\u30D4\u30E5\u30E9\u30FC\u3067\u3068\u3066\u3082\u4E0A\u624B\u304F\u8A2D\u8A08\u3055\u308C\u3066\u3044\u308B",
