  "getting-started.subsection.create-translations": "\u7FFB\u8A33\u3092\u4F5C\u6210\u3059\u308B",
  "getting-started.paragraph.create-translations-1": (dir1, dir2, or) => `\u6B21\u306B\u3001\u7FFB\u8A33\u30D5\u30A1\u30A4\u30EB\u3092\u683C\u7D0D\u3059\u308B\u30D5\u30A9\u30EB\u30C0\u3092\u4F5C\u6210\u3057\u307E\u3059\u3002 ${__interpolate(dir1)} ${__interpolate(or)} ${__interpolate(dir2)} \u3068\u3044\u3063\u305F\u540D\u524D\u306E\u30D5\u30A9\u30EB\u30C0\u3092\u30D7\u30ED\u30B8\u30A7\u30AF\u30C8\u30EB\u30FC\u30C8\u306B\u7F6E\u304F\u3068\u826F\u3044\u3067\u3057\u3087\u3046`,
