  "getting-started.paragraph.create-translations-4": "\u4F5C\u8005\u306F\u4E0A\u8A18\u306E\u3088\u3046\u306A\u30D5\u30E9\u30C3\u30C8\u306A\u8F9E\u66F8\u69CB\u9020\u304C\u597D\u307F\u3067\u3059\u304C\u3001\u8907\u6570\u306E\u968E\u5C64\u3092\u542B\u3080\u8F9E\u66F8\u69CB\u9020\u3092\u4F7F\u3063\u3066\u7FFB\u8A33\u30D5\u30A1\u30A4\u30EB\u3092\u5B9A\u7FA9\u3057\u3066\u3082\u69CB\u3044\u307E\u305B\u3093:",
